import React, { useState, useEffect } from "react";
import {
  BarChart,
  Bar,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  ResponsiveContainer,
} from "recharts";
import { Button } from "@/components/ui/button";

// Example data for analytics
const userGrowthData = [
  { month: "Jan", users: 40 },
  { month: "Feb", users: 80 },
  { month: "Mar", users: 65 },
  { month: "Apr", users: 120 },
  { month: "May", users: 90 },
];

export default function AdminDashboard() {
  const [activeTab, setActiveTab] = useState("overview");

  // Users state
  const [users, setUsers] = useState([
    { id: 1, name: "Alice", role: "Admin", status: "Active" },
    { id: 2, name: "Bob", role: "User", status: "Suspended" },
    { id: 3, name: "Charlie", role: "User", status: "Active" },
  ]);
  const [selectedUsers, setSelectedUsers] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");

  // Logs state
  const [logs, setLogs] = useState([
    { id: 1, action: "User Login", date: "2025-08-10" },
    { id: 2, action: "File Uploaded", date: "2025-08-11" },
  ]);
  const [page, setPage] = useState(1);
  const logsPerPage = 5;

  // Handle bulk selection
  const toggleUserSelection = (id) => {
    setSelectedUsers((prev) =>
      prev.includes(id) ? prev.filter((u) => u !== id) : [...prev, id]
    );
  };

  const bulkAction = (action) => {
    if (selectedUsers.length === 0) return;
    setUsers((prev) =>
      prev.map((u) =>
        selectedUsers.includes(u.id)
          ? {
              ...u,
              status:
                action === "suspend"
                  ? "Suspended"
                  : action === "promote"
                  ? "Admin"
                  : "Deleted",
            }
          : u
      )
    );
    setSelectedUsers([]);
  };

  // Filtered users
  const filteredUsers = users.filter((u) =>
    u.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  // Paginated logs
  const paginatedLogs = logs.slice((page - 1) * logsPerPage, page * logsPerPage);

  return (
    <div className="p-6 bg-gray-50 min-h-screen">
      {/* Tabs as buttons */}
      <div className="flex space-x-4 mb-6">
        {["overview", "users", "logs", "settings"].map((tab) => (
          <Button
            key={tab}
            onClick={() => setActiveTab(tab)}
            className={`px-4 py-2 rounded-lg ${
              activeTab === tab
                ? "bg-blue-600 text-white"
                : "bg-gray-200 text-gray-700"
            }`}
          >
            {tab.charAt(0).toUpperCase() + tab.slice(1)}
          </Button>
        ))}
      </div>

      {/* Overview */}
      {activeTab === "overview" && (
        <div>
          <h2 className="text-2xl font-bold mb-4">Overview & Analytics</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div className="p-4 bg-white rounded-xl shadow">
              <h3 className="font-semibold mb-2">User Growth</h3>
              <ResponsiveContainer width="100%" height={250}>
                <BarChart data={userGrowthData}>
                  <CartesianGrid strokeDasharray="3 3" />
                  <XAxis dataKey="month" />
                  <YAxis />
                  <Tooltip />
                  <Bar dataKey="users" fill="#3b82f6" radius={[8, 8, 0, 0]} />
                </BarChart>
              </ResponsiveContainer>
            </div>
            <div className="p-4 bg-white rounded-xl shadow">
              <h3 className="font-semibold mb-2">Quick Stats</h3>
              <ul className="space-y-2">
                <li>Total Users: {users.length}</li>
                <li>Admins: {users.filter((u) => u.role === "Admin").length}</li>
                <li>Active Users: {users.filter((u) => u.status === "Active").length}</li>
              </ul>
            </div>
          </div>
        </div>
      )}

      {/* Users */}
      {activeTab === "users" && (
        <div>
          <h2 className="text-2xl font-bold mb-4">Manage Users</h2>
          <div className="flex items-center space-x-2 mb-4">
            <input
              type="text"
              placeholder="Search users..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              className="border px-3 py-2 rounded-lg w-64"
            />
            <Button onClick={() => bulkAction("suspend")}>Suspend</Button>
            <Button onClick={() => bulkAction("promote")}>Promote</Button>
            <Button onClick={() => bulkAction("delete")}>Delete</Button>
          </div>
          {filteredUsers.length === 0 ? (
            <p className="text-gray-500">No users found.</p>
          ) : (
            <table className="w-full border rounded-lg overflow-hidden">
              <thead className="bg-gray-200">
                <tr>
                  <th className="p-2">Select</th>
                  <th className="p-2">Name</th>
                  <th className="p-2">Role</th>
                  <th className="p-2">Status</th>
                </tr>
              </thead>
              <tbody>
                {filteredUsers.map((u) => (
                  <tr key={u.id} className="border-t">
                    <td className="p-2 text-center">
                      <input
                        type="checkbox"
                        checked={selectedUsers.includes(u.id)}
                        onChange={() => toggleUserSelection(u.id)}
                      />
                    </td>
                    <td className="p-2">{u.name}</td>
                    <td className="p-2">{u.role}</td>
                    <td className="p-2">{u.status}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}
        </div>
      )}

      {/* Logs */}
      {activeTab === "logs" && (
        <div>
          <h2 className="text-2xl font-bold mb-4">System Logs</h2>
          {logs.length === 0 ? (
            <p className="text-gray-500">No logs available.</p>
          ) : (
            <div>
              <ul className="space-y-2">
                {paginatedLogs.map((log) => (
                  <li
                    key={log.id}
                    className="p-3 bg-white rounded-lg shadow border"
                  >
                    <strong>{log.action}</strong> - {log.date}
                  </li>
                ))}
              </ul>
              <div className="flex justify-between mt-4">
                <Button
                  disabled={page === 1}
                  onClick={() => setPage((p) => p - 1)}
                >
                  Previous
                </Button>
                <Button
                  disabled={page * logsPerPage >= logs.length}
                  onClick={() => setPage((p) => p + 1)}
                >
                  Next
                </Button>
              </div>
            </div>
          )}
        </div>
      )}

      {/* Settings */}
      {activeTab === "settings" && (
        <div>
          <h2 className="text-2xl font-bold mb-4">Admin Settings</h2>
          <p className="text-gray-600">Here you can configure system settings.</p>
        </div>
      )}
    </div>
  );
}
